import React, { useState } from 'react'

const Languages = (props) => {

    // useState()
    const [languagesOpen, setLanguagesOpen] = useState(false)

    return (
        <>
            <button type='button' onClick={() => setLanguagesOpen(!languagesOpen)}>
                EN
                <img
                    src={'./assets/image/svg/arrow'}
                    alt={'arrow'}
                    className={languagesOpen ? null : 'img-closed'}
                />
            </button>
        </>
    )
}

export default Languages
